INSERT INTO `catalog` VALUES (34,'GMS','Решения для водяных насосов и коллекторов','/img/goods/promo/gms.jpg','a2a12edf-1642-11ee-0a80-13ab00041ab9','<h4>О нас</h4> <p>Основанная в 1967 году, как небольшая мастерская, наша компания,\n                сначала производита только серый чутун. В 1972 года, вместе с уже\n                работающим литейным блоком, был запущен и процессорный блок.\n                Сегодня наша компания продолжает свою деятельность в\n                Организованной промышленной зоне города Конья на площади 10000 м <sup>2</sup> \n                Закрытый Литейный цех — занимает около 2500 м<sup>2</sup>\n                производственной площади. Кроме того, мы работаем с процессором!\n                площадь которого - 2000 м<sup>2</sup>.</p> <p>В наших литейных установках мы производим детали из серого (GG) и\n                сферического (GGG) видов чугуна, и обслуживаем все отрасли:\n                промышленности, использующие литые детали</p> <p>C GMS, Waterpump &amp; Exhaust Manifold. наша фирма является ведущим.\n                поставщиком и партнером по развитию автомобильной\n                промышленности и пионером в инновациях будущего.</p> <h4>ЛИТЬЁ</h4> <p>Наш процесс литья в песчаные формы позволяет успешно отливать продукцию малых и средних серий из широкого спектра сплавов. В\n                нашем ручном формовочном цехе мы занимаемся штучным производством, используя установку для литья холодных смол или\n                автоматическую формовочную машину для крупных блоков.</p> <h4>ОБРАБОТКА</h4> <p>Наши процессы обработки с ЧПУ включают в себя все виды токарной обработки, сверления, фрезерования и многое другое. Используемые\n                нами токарные станки и приспособления для крепления удовлетворят все ваши требования. Среди оборудования нашей фирмы имеются\n                3, 4 и 5-осевые станки, Кроме того, мы обеспечиваем внутреннюю фиксацию и инструментацию всей нашей продукции. Все наше\n                оборудование отвечает самыми передовыми технологиям и высшим требованиям качества.</p> <h4>УПАКОВКА</h4> <p>Упаковка должна отражать качество продукта, а девиз нашей компании - поставка продукции клиенту в элегантной упаковке.</p> <h4>КОНТРОЛЬ КАЧЕСТВА</h4> <p>Наша система обеспечения качества изготовленных деталей основана на использовании новейшего измерительного и испытательного!\n                оборудования.</p> <p>Твердомер.</p> <p>Используется при периодических испытаниях твердости производимых деталей. Твердомер также используется для подтверждения: того,\n                что указанная твердость является фиксированной до и после термообработки</p> <p>Измерительное оборудование 3D<br>\n                Это оборудование используется для измерения соответствия производимых нами деталей дизайну клиента.\n                Также оно используется для описания таблиц данных измерений.</p>','/img/goods/promo/2022_katalog gms.pdf','2023-06-22 14:13:00','2023-07-03 11:13:15'),(35,'Gearax','Дифференциальные и зубчатые системы','/img/goods/promo/gearax.jpg','254c7d33-15ba-11ee-0a80-09a00027e0da','<h4>О нас</h4>\n<p>GEARAX ® Koçlar Otomotiv является официально зарегистрированной торговой маркой.</p>\n<p>Мы производим дифференциалы и запасные части в основных группах \"Легкие коммерческие автомобили\", \"Грузовые автомобили и пикапы\", \"Строительные машины\" и \"Внедорожники\".</p>\n\n<p>Марки и модели: Mercedes-Benz, Volkswagen, Man, Ford, Iveco, Isuzu, Dodge, Fiat, Freightliner, Tümosan, New Holland и Carraro - мы продолжаем расти благодаря постоянно расширяющемуся ассортименту продукции.</p>\n<p>Gearax, следуя и используя современные технологические возможности, приняла систему всеобщего управления качеством со своими инженерами, техниками и опытным персоналом, и производит различные части в автомобильном секторе.</p>\n<p>Gearax начинала свою деятельность как OEM, OES, AFTERMARKET поставщик в 1960-х годах и\nначала производить компоненты и все дифференциалы, производство шестерен и системных деталей из металлов таких как сталь, ковка, литье, алюминий.</p>\n\n\n<h4>НАШИ ЦЕННОСТИ</h4>\n<strong>МЫ ВЕРИМ В ПРОЧНОЕ СОТРУДНИЧЕСТВО</strong>\n<ul>\n<li>Мы строим устойчивые отношения с нашими клиентами.</li>\n<li>Мы доверяем нашим клиентам и считаем их мнение своим собственным.</li>\n<li>Мы мыслим практично и строим прочные деловые партнерства.</li>\n<li>Мы устанавливаем эффективные и прочные деловые партнерские отношения, какими они и должны быть.</li>\n</ul>\n\n<strong>МЫ ВЕРИМ В НАШУ СТРАСТЬ К ПРОИЗВОДСТВУ</strong>\n<ul>\n<li>Мы стремимся к успеху в производстве благодаря нашему механизму, который отслеживает все процессы от сырья до конечного продукта.</li>\n<li>Мы принимаем нашу утвержденную цепочку поставщиков как неотъемлемую часть нашей системы.</li>\n<li>Мы добиваемся успеха в производстве благодаря нашей честности, добросовестности и этичным методам ведения бизнеса, работа со стандартами, основанными на честности и высокой деловой этике, является частью сути нашего бизнеса.</li>\n<li>Мы никогда не идем на компромисс в вопросах качества и времени, мы измеряем эффективность работы.</li>\n</ul>\n\n<strong>МЫ ВЕРИМ В ПОДХОДЫ, ОРИЕНТИРОВАННЫЕ НА РЕШЕНИЕ ПРОБЛЕМ</strong>\n<ul>\n<li>Мы решаем все возможные проблемы и кризисы, беря на себя ответственность.</li>\n<li>Мы создаем решения, которые повышают значимость и ценность для наших клиентов.</li>\n<li>Мы верим в развитие идей, которые добавляют ответственность и ценность и приводят к решениям.</li>\n<li>Мы доказываем, что мы ответственны и ориентированы на решения в наших действиях и решениях.</li>\n</ul>\n\n<strong>МЫ ВЕРИМ В ВДОХНОВЕНИЕ, ЧТОБЫ БЫТЬ ВДОХНОВЛЕННЫМИ</strong>\n<ul>\n<li>Мы работаем в команде и стремимся к постоянному успеху.</li>\n<li>Мы мыслим позитивно и стремимся преодолеть негатив.</li>\n<li>Мы развиваем друг друга и открыты для постоянного совершенствования.</li>\n<li>Как компания, мы стремимся быть объективным партнером в вашей ситуации.</li>\n</ul>\n\n<strong>МЫ ВЕРИМ В ПОСТОЯННОЕ ПЛАНОМЕРНОЕ РАЗВИТИЕ</strong>\n<ul>\n<li>Мы доверяем себе и своим сотрудникам.</li>\n<li>Мы открыты для обучения и любопытны, мы задаем вопросы, рассматриваем и обсуждаем проблемы, мы верим в планирование для получения решений.</li>\n<li>Мы эффективно используем и управляем временем и следим за развитием событий.</li>\n<li>Мы придаем большое значение личному развитию, мы работаем, чтобы достичь того, что нам нужно достичь.</li>\n</ul>\n\n<p>Эти пять ценностей - наши главные ценности, которые делают нас теми, кто мы есть.</p>\n\n<h4>Упаковка</h4> \n<p>Gearax - упаковывают свой товар с большой ответственностью и вниманием к деталям.</p>\n<p>Gearax гарантируют, что каждый товар будет упакован таким образом, чтобы он оставался в идеальном состоянии во время транспортировки и доставки.</p>\n<p>Gearax осуществляет доставку своих товаров по всему миру, поэтому им важно, чтобы товары были упакованы надежно и безопасно. Компания использует различные материалы для упаковки, включая пузырчатую пленку, картон и крепкие коробки. Они также обеспечивают защиту товаров от пыли и влаги. </p>\n\n<h4>Контроль качества</h4> \n<p>Одним из важных аспектов бизнеса Gearax является контроль качества товаров.</p>\n<p>Gearax придает большое значение контролю качества своих товаров и гарантирует, что все товары, которые они предлагают, соответствуют высоким стандартам.</p>','/img/goods/promo/GEARAX.pdf','2023-06-22 14:21:22','2023-06-22 14:21:22');
